import React, { Component } from 'react'

export default class AddFolder extends Component {
    render () {
        return (
            <div>
                <form>
                    <input type="text" name="newFolder">Enter name of folder</input>
                    <input type="submit" value="Submit"></input>
                </form>
            </div>
        )
    }
}
